import React, { Component } from 'react'
import "./App.css";

class ListProducts extends Component {

  state = {  }

  componentDidMount = async () => {
  };


  render() {
    return (
      <div className="App">
        <h1>Airdrop</h1>
        {this.props.nfts.map((nft, key) => {
          if (nft.purpose == 0) {
            return (
              <div class="nft">
                <p>Id: {nft.id}</p>
                <p>Title: {nft.title}</p>
                <p>Description: {nft.description}</p>
                <p>Price: {nft.price}</p>
                <p>Status: {nft.status}</p>
              </div>
            );
          }
        })}
      </div>
    );
  }
}

export default ListProducts;
